import {BrouseRouter, Route, Routes} from 'react-router-dom';
import Home from './Home';
function App() {
  return (
    <>
    <BrouseRouter>
    <Routes>
      <route path="/" element={<Home/>} />
    </Routes>
    </BrouseRouter> 
    </>
  );
}

export default App;
